												[~There's Nene's house, right up there!~]),
		
		
		end_script()]"
		target="level.player"
		[/modification]

	[/script]

	[script]
	id="dialog_2"
		[modification]
		on_process="[end_script(), speech_dialog(self, set(level.zoom, 2), music('MilgramSwagger.ogg'),
									[~A moment of your time sir?~],
									set(level.player.animation, 'emote_geez'),
									level.player, [~Sorry, I'm off to town!\nNot interested!~],
									self, [~But the town is under attack!~],
									set(level.player.animation, 'emote_oh'),
									level.player, [~Wait .. WHAT?~],
									self, [~It's Milgram!\nYou may remember him loaning a bunch\nof money to the elder, back in the day.~],
									set(level.player.animation, 'emote_confused'),
									level.player,[~No... but,\nI think I see where this is going.~],
									self, [~Milgram came to collect!~], [~He's cordoned off the town, and won't\nlet anyone leave until he's paid in full.~],
									set(level.player.animation, 'emote_oh'),
									level.player,[~Yeesh. Sounds awful.~],
									self, [~Yes, we're desperate!\nWe'd give ANYTHING if you can help!~],
									set(level.player.animation, 'emote_raisedfinger'),
									level.player,[~I'll accept that offer!~],
									self, [~Er... I'm not sure I ..~],
									set(level.player.animation, 'emote_talk'),
									level.player,
									[~If I actually manage to save you,\nbe prepared to pay ANY reward I ask.~],
									set(level.player.animation, 'emote_oh'),
									[~Yes, it's an absurd price,\nbut you're asking the impossible.~],									
									self, [~Oh dear me...~], [~I suppose I can't say no,\nthough, can I?~], [~Very well.\nPlease do whatever you can.~],
									set(level.player.animation, 'emote_nod'),
									level.player, [~Don't worry, I don't disappoint!~],
									self, [~Right then.  I'll be seeing you.~],
									music('FrogattoChill.ogg'), set(level.zoom, 1),
									facing(1),animation('fly_up'),
									set(level.player.vars.triggered_events, level.player.vars.triggered_events + ['berds-first-speech']))]"
		target="get_object(level,'berd_man')"
		[/modification]

	[/script]

